import React from 'react';
import TodoListItems from '../todo-list-items';
import './todo-list.css';


const TodoList = ( { todoArray, onDelete, onImportant, onDone } ) => {

    const element = todoArray.map((item) => {

        const { id, ...itemWithOutKey } = item;
        return(
            <li key ={id}  className = 'list-group-item'> 
                <TodoListItems {...itemWithOutKey}  onDelete = {() => onDelete(id)} 
                                                    onImportant = {() => onImportant(id)}/> 
            </li>
        )
    });

    return (
        <ul className = 'list-group todo-list'>
            { element }
        </ul>
    )
}

export default TodoList;
